import { Routes, Route } from "react-router-dom";
import About from "./About";
const Button = ({ buttonText }) => {
    return (
        <button
            className={buttonText}
            type="submit"
            onClick={() => {
                <Routes>
                    <Route path="/about" element={<About />} />;
                </Routes>;
            }}
        >
            {buttonText}
        </button>
    );
};

export default Button;
